Arrays are a type of finite generator. const friends = ["Bob", "Alice", "Sally"]; loop friend of friends { stdout.write_line(`I have a friend named {friend}.`);
} Any range between two i64 or u64 values is also a finite generator. Ranges are denoted using the .. operator ("range operator"). loop 0 .. 5 { stdout.write_line("Hi.");
} loop num of 0 .. 5 { stdout.write_line(`num: {num}`);
}

